/// name : "高清"
/// type : "high"
/// url : "http://baobab.kaiyanapp.com/api/v1/playUrl?vid=220769&amp;resourceType=video&amp;editionType=high&amp;source=aliyun&amp;playUrlType=url_oss&amp;udid=7a5bd452383b40a1804972422eef008361cf87b8"

class PlayInfo {
  int height;
  int width;
  List<UrlList> urlList;
  String name;
  String type;
  String url;

  PlayInfo(
      {this.height, this.width, this.urlList, this.name, this.type, this.url});

  PlayInfo.fromJson(dynamic json) {
    height = json["height"];
    width = json["width"];
    if (json["urlList"] != null) {
      urlList = [];
      json["urlList"].forEach((v) {
        urlList.add(UrlList.fromJson(v));
      });
    }
    name = json["name"];
    type = json["type"];
    url = json["url"];
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map["height"] = height;
    map["width"] = width;
    if (urlList != null) {
      map["urlList"] = urlList.map((v) => v.toJson()).toList();
    }
    map["name"] = name;
    map["type"] = type;
    map["url"] = url;
    return map;
  }
}

